    {
      "cell_type": "markdown",
      "metadata": {
        "id": "bPqf1fCcB5WH"
      },
      "source": [
        "**Definición del contexto y descripción del problema a tratar**\n",
        "\n",
        "Desde el concepto de ciudades inteligentes, recae inmediatamente al acceso de información a los consumidores, es decir, que existan mayores herramientas o vías de información de fácil accesibilidad para la medición de precios.\n",
        "\n",
        "El fin de este trabajo es poder dar una idea de cómo sería presentar precios de bienes de forma geográfica a los consumidores, acompañado de las variaciones que sufren desde una fecha específica y según su cadena o ubicación. \n",
        "\n",
        "Actualmente ya existen sitios web de precios como la dirección General de Comercio, o aplicaciones como GoogleMaps, Amazon o PedidosYa. Los medios gubernamentales suelen no ser de fácil acceso, y para el caso de las aplicaciones, estos no presentan informaciones tabuladas o solo están enfocados en ofrecer recomendaciones de consumo. Por lo tanto, el proyecto trata de darle nociones al consumidor de la existencia de la oferta desde una perspectiva panorámica y de fácil acceso para la toma de decisiones de consumo.\n",
        "\n",
        "Otra idea que surge en el desarrollo del proyecto, es de ofrecer la oportunidad al consumidor de que tenga una noción de las existencias de cadenas monopólicas, para visualizar sus comportamientos a lo largo del tiempo y sus estrategias dentro del mercado. La información de precios permite darle mayor juicio a la hora de consumir como también obliga a las cadenas a ser más competitivas y ser más cuidadosas al momento de discriminar precios.\n"
      ]
    },
    {
      "cell_type": "markdown",
      "metadata": {
        "id": "fqIYPSiIDhtK"
      },
      "source": [
        "**Fuentes de datos**\n",
        "\n",
        "Fuente: Dirección General de Comercio (http://www.precios.uy/).\n",
        "Las bases fueron proveídas por docentes de la Facultad de Ciencias Sociales de la Udelar. Las bases de los bienes de consumo estaban limpias y adecuadamente segmentadas. \n",
        "\n",
        "El desafío se concentró en las bases de los almacenes y de barrios que estaban desordenadas y mucha información disueltas en diferentes celdas. \n",
        "\n",
        "Repasando las horas de dedicación en el trabajo, la preparación de la base tomó algunos días, posiblemente par de semanas en tenerlas listas previo a su análisis.\n",
        "\n",
        "**Métodos utilizados en el análisis**\n",
        "\n",
        "Análisis descriptivo\n",
        "\n",
        "Análisis Exploratorio\n"
      ]
    },
    {
      "cell_type": "markdown",
      "metadata": {
        "id": "hvWgbN5SD0tR"
      },
      "source": [
        "**Resultados y conclusiones**\n",
        "\n",
        "De acuerdo a los resultados obtenidos, se puede apreciar que los precios varían, pero no significativamente. Los Barrios y Cadenas no son variables determinantes para la variación de precios, pero si lo es la fecha, como son las variaciones con respecto al año anterior e incluso a meses anteriores. Existe problema de endogeneidad como la inflación o la presencia de shocks internos o externos.\n",
        "\n",
        "A pesar de que los precios no sufren variaciones significativas por barrios o cadenas para una fecha determinada, sería interesante poder comparar con mayores bienes de consumo, lo suficiente para formar una canasta familiar y hacer el comparativo en conjunto para que sea de mayor interés del consumidor, especialmente para la población de menores ingresos o como plan de ahorro de consumo familiar.\n",
        "\n",
        "El trabajo puede seguir madurando desde la vía de la programación, como manipular más con el paquete Bokeh y agregar SELECT y SLIDERS a través de callbacks para que el usuario pueda ver los precios según el mes, año, tipo de producto, cadena e incluso añadir más bienes dentro de un mismo análisis. A su vez, se puede agregar más variable económicas a la base como la inflación correspondiente a cada fecha, para así presentar un indicador adicional al Plot. \n"
      ]
    },
